import React from "react";
import {
  Text,
  View,
  StyleSheet,
  TouchableOpacity,
  Modal,
  AsyncStorage,
  FlatList,
  Image,
  Animated,
  ScrollView,
  Dimensions,
} from "react-native";
import Constants from "expo-constants";
import {
  Ionicons,
  Entypo,
  MaterialCommunityIcons,
  Octicons,
  FontAwesome,
  AntDesign,
} from "@expo/vector-icons";

let TAG = "Animation ";
const SCREEN_HEIGHT = Dimensions.get("window").height;
const SCREEN_WIDTH = Dimensions.get("window").width;

import { connect } from "react-redux";
import { AppColors, AppFonts, AppAlert } from "../../../theme/index";
import { Actions } from "react-native-router-flux";
import * as Location from "expo-location";
import * as Permissions from "expo-permissions";

import * as UserActions from "../../../redux/user/actions";
import { AppText, Loader } from "../../../components/ui/index";
import { TextInput } from "react-native-gesture-handler";
import { AnimatedLoader } from "../../../components/ui/index";
const mapStateToProps = (state) => ({
  user_favorite: state.user.user_favorite,
});

// Any actions to map to the component?
const mapDispatchToProps = {
  updateUserFavorites: UserActions.updateUserFavorites,
};

let header_height = 120;
let min_header_height = 70;
let image_height = 100;
let min_image_height = 40;

class Animation extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      visible: true,
      scrollY: new Animated.Value(0),
    };
  }
  componentDidMount = async () => {};
  AnimatedHeader = () => {
    const headerHeight = this.state.scrollY.interpolate({
      inputRange: [0, header_height - min_header_height],
      outputRange: [image_height, min_image_height],
      extrapolate: "clamp",
    });
    const imageHeight = this.state.scrollY.interpolate({
      inputRange: [0, image_height - min_image_height],
      outputRange: [image_height, min_image_height],
      extrapolate: "clamp",
    });
    const imageMarginHeight = this.state.scrollY.interpolate({
      inputRange: [0, header_height - min_header_height],
      outputRange: [header_height - image_height / 2, header_height],
      extrapolate: "clamp",
    });
    const headerZindex = this.state.scrollY.interpolate({
      inputRange: [0, header_height - min_header_height],
      outputRange: [0, 1],
      extrapolate: "clamp",
    });
    return (
      <Animated.View style={{ flex: 1, backgroundColor: AppColors.background }}>
        <Animated.View
          style={{
            height: headerHeight,
            backgroundColor: AppColors.secondary,
            position: "absolute",
            zIndex: headerZindex,
            top: 0,
            left: 0,
            right: 0,
          }}
        ></Animated.View>
        <ScrollView
          style={{ flex: 1 }}
          // scrollEventThrottle={16}
          onScroll={Animated.event([
            { nativeEvent: { contentOffset: { y: this.state.scrollY } } },
          ])}
        >
          <Animated.View
            style={{
              // position: "absolute",
              // top: header_height - image_height / 2,
              marginTop: imageMarginHeight,
              height: imageHeight,
              width: imageHeight,
              borderRadius: image_height / 2,
              marginLeft: 20,
              backgroundColor: AppColors.white,
              overflow: "hidden",
            }}
          >
            <Image
              style={{ flex: 1 }}
              source={{
                uri:
                  "https://i.ebayimg.com/images/g/DHwAAOSwiYlaEjDa/s-l300.jpg",
              }}
            ></Image>
          </Animated.View>
          <View style={{ height: 1000 }}></View>
        </ScrollView>
      </Animated.View>
    );
  };

  deckSwiper = () => {
    const ARTICLES = [
      {
        _id: 1,
        image: "https://i.ebayimg.com/images/g/DHwAAOSwiYlaEjDa/s-l300.jpg",
      },
      {
        _id: 2,
        image:
          "data:image/jpeg;base64,",
      },
      {
        _id: 3,
        image:
          "data:image/jpeg;base64,",
      },
      {
        _id: 4,
        image:
          "data:image/jpeg;base64,",
      },
      {
        _id: 5,
        image:
          "data:image/jpeg;base64,",
      },
    ];
    return ARTICLES.map((item, i) => {
      return (
        <Animated.View key={item._id}>
          <View
            style={{
              flex: 1,
              height: SCREEN_HEIGHT,
              width: SCREEN_WIDTH,
              position: "absolute",
              backgroundColor: AppColors.white,
            }}
          >
            <View style={{ flex: 2 }}>
              <Image
                style={{ flex: 1, resizeMode: "contain" }}
                source={{ uri: item.image }}
              ></Image>
            </View>
            <View style={{ flex: 3, padding: 10 }}>
              <Text>
                An article is a word that is used with a noun to specify
                grammatical definiteness of the noun, and in some languages
                extending to volume or numerical scope. The articles in English
                grammar are the and a/an, and in certain contexts some An
                article is a word that is used with a noun to specify
                grammatical definiteness of the noun, and in some languages
                extending to volume or numerical scope. The articles in English
                grammar are the and a/an, and in certain contexts some An
                article is a word that is used with a noun to specify
                grammatical definiteness of the noun, and in some languages
                extending to volume or numerical scope. The articles in English
                grammar are the and a/an, and in certain contexts some
              </Text>
            </View>
          </View>
        </Animated.View>
      );
    });
  };
  render() {
    return (
      <Animated.View style={styles.container}>
        {/* <AnimatedLoader visible={this.state.visible} /> */}
        {this.deckSwiper()}
      </Animated.View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: AppColors.green,
    marginTop: Constants.statusBarHeight,
  },
  location_box: {
    height: 40,
    backgroundColor: "white",
    justifyContent: "center",
    alignItems: "center",
    marginHorizontal: 40,
    marginBottom: 10,
  },
  render_header: {
    height: 50,
    backgroundColor: AppColors.white,
    borderWidth: 0.5,
    borderColor: AppColors.grey,
    flexDirection: "row",
    alignItems: "center",
  },
});
export default connect(mapStateToProps, mapDispatchToProps)(Animation);
